thank goodness someone finally said it @terryderon !! i also noticed a lot of single women say these things when describing why they’re still single, “cuz i know my worth. cuz i’m not tryna settle. cuz i’m dating with a purpose.” recently i had a convo w/ a woman who actually admitted to doing this cuz it avoided her having to dig deep or look at why she really was still single, when she considered herself a “package”. i’m going to start calling these lines defence mechanisms’ lol. #therationalfemale  #womenbelike #foolish #doublestandards #datingin2018 #datingadvice  #femaleprivilege #dontsettle #knowyourworth #rational #fuckfeminism #realtalk #metoo  #womanempowerment #singleaf #antifeminist #yoga #foodie #callingyouout #model #datingwithapurpose #relationshipsbelike #singlemom #stupidity #relationshipadvice #redpill #dumbaf #feminine #godlydating101 #facts💯

